import React, { useEffect, useState } from "react";
import { useAircrafts, useFlights } from "../../hooks";
import { Page } from '../../components';
import Grid from "@mui/material/Grid";
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import { styled } from '@mui/material/styles';
import ArrowBackIosIcon from "@mui/icons-material/ArrowBackIos";
import ArrowForwardIosIcon from "@mui/icons-material/ArrowForwardIos";
import "./MainPage.css";
import { Flights } from "./Flights";

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
  width: "50vh",
  height: "16vh"
}));

/* type Props = {}; */

const MainPage: React.FC = () => {
  const { flights, isLoadingFlights } = useFlights({
    offset: 0,
    limit: 0,
  });
  const { aircrafts, isLoadingAircrafts } = useAircrafts({
    offset: 0,
    limit: 0,
  });

  console.log('->', aircrafts);
  console.log("->", flights);


  return (
    <Page>
      <Grid sx={{ flexGrow: 1 }} container spacing={2}>
        <Grid item xs={12}>
          <Grid container justifyContent="center" spacing={2}>
            <Grid key={"header"} item>
              <div style={{ display: "flex" }}>
                <ArrowBackIosIcon />
                <div style={{paddingTop: "3px", paddingRight: "5px"}}>{"4th January 2018"}</div>
                <ArrowForwardIosIcon />
              </div>
              <div>{"Rotation ABCDE"}</div>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
      <Grid sx={{ flexGrow: 1 }} container spacing={2}>
        <Grid item xs={12}>
          <Grid container justifyContent="center" spacing={2}>
            <Grid key={"aircrafts-list"} item>
              <Paper sx={{ height: "90vh", width: "30vh" }}>
                Aircrafts babez
              </Paper>
            </Grid>
            <Grid key={"rotation-list"} item>
              <div>
                <Stack spacing={2}>
                  <Item>Item 1</Item>
                  <Item>Item 2</Item>
                  <Item>Item 3</Item>
                </Stack>
              </div>
            </Grid>
            <Grid key={"flights-list"} item>
              <Flights flights={flights}/>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Page>
  );
};

export default MainPage;
